import {useState} from 'react';

const Graph = ({...nodes}) => {
    const [datas, setDatas] = useState([])

    if (nodes.length > 0) {
        setDatas(nodes)

        return (
            datas.map((data) => (
                <div>
                    <p>{data.identity}</p>
                    <p>{data.labels}</p>
                    <p>{data.properties.name}</p>
                    <p>{data.properties.neo4jImportId}</p>
                </div>
            ))
        )
    } else {
        return (<div></div>)
    }

}

export default Graph
